import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  container: {
    alignSelf: 'stretch',
    flex: 0.12,
    flexDirection: 'row',
    justifyContent: "space-between",
    backgroundColor: '#ff3300',
    height: 100,
    alignItems: 'flex-end'
  },

  logo: {
    width: 55,
    height: 55,
  },

  hamburguer: {
    marginRight: 10,
    marginBottom: 3,
    width: 50,
    height: 50,
    justifyContent: 'flex-end',
  }
});

export default styles;
